import styles from './index.css'; 
import btc from './images/bitcoin.png'
import DropDown from "@material-ui/icons/KeyboardArrowDown";

const Navbar = () => {
  return (
    <div class="NavBar" style={styles.NavBar}>
       <div style={{border: '1 solid gray', width: 20, paddingLeft: 100}}>
        <div style={{display: 'flex'}}>
        <img src={btc} style={{height: 50, width: 50, padding:15}}></img>
          <div style={{display: 'block'}}>
        <h5 style={{color: 'white', lineHeight: 0, paddingTop:10}}>BitCoin</h5>
        <h5 style={{color: 'gray', lineHeight: 0}}>BTC/USDC</h5>
        </div>
        <DropDown style={{color: 'white', paddingTop:10, fontSize: 40}}></DropDown>
        </div>
       </div>
    </div>
  );
};

export default Navbar;
